import React, {useEffect, useState} from 'react';
import { useNavigate } from "react-router-dom";
import Nav from './Nav'; 

function Sadmin(){

    const [email, setEmail] = useState([]);
    const [password, setPassword] = useState([]);
    const navigate = useNavigate();

    const handleEmailChange = event => {

        setEmail(event.target.value);
      }


    const handlePasswordChange = event => {

        setPassword(event.target.value);
      }


      const handleSubmit = (e) => {
        e.persist();
        e.preventDefault();
        //foodbank-admin@seuo-uosu.ca'
        if (email === 'lol' && password === '123'){
            navigate('/adminhome')   

        }else{
            alert('wrong password or username')
        }

    }
    return(
        <section>
            <Nav/>
            <body class="bg-light text-dark p-5 text-center">
                <h1 style={{paddingBottom: '70px'}} >Admin sign in page</h1>
                <div class="form-floating mb-3">
                    <input type="email" onChange={handleEmailChange} class="form-control" id="floatingInput" placeholder="name@example.com"/>
                    <label for="floatingInput">Email address</label>
                </div>
                <div class="form-floating">
                    <input type="password" class="form-control" onChange={handlePasswordChange}  id="floatingPassword" placeholder="Password"/>
                    <label for="floatingPassword">Password</label>
                </div>
                <button class="btn btn-primary  w-50" type="button" onClick={handleSubmit}  style={{marginTop: '40px'}} >Sign-in</button>
            </body>

        </section>
    );
}

export default Sadmin;
